void normalize()
{
    for ( ListIterator<Item> iterator = listIterator( size() ); iterator.hasPrevious(); )
    {
        Item item = iterator.previous();
        if ( item.isNull() )
        {
            iterator.remove(); // remove null trailing items: 0, "", empty list
        }
        else
        {
            break;
        }
    }
}
